import { useEffect, useState } from 'react';
import 'react-bootstrap'
import './Dashboard.css'
import Navbar from './ICCRNavbar';
import Sidebar from './ICCRSidebar'
import axios from 'axios';
import Button from 'react-bootstrap/Button';
import Card from 'react-bootstrap/Card';

const ICCRManageEvent = () => {


    const [record, setRecord] = useState([])
    const [ROdata, setROdata] = useState({})

    let officeName = "ROMumbai"

    useEffect(() => {

        var config = {
            method: 'get',
            url: 'http://localhost:8001/ROEvent/getEvents',
            headers: {
                'Content-Type': 'application/json'
            }
        };

        axios(config)
            .then(function (response) {
                if (response.status === 200) {
                    console.log(response.data)
                }

            })
            .catch(function (error) {
                alert(error.response.data)

            });

    }, [])


    const getData = () => {
        fetch('https://jsonplaceholder.typicode.com/users')
            .then(resposne => resposne.json())
            .then(res => setRecord(res))
    }

    useEffect(() => {
        getData();
    })


    return (
        <>
            <header>ICCR Office Dashboard</header>
            <Navbar />

            <section className='ro-section'>

                <Sidebar />

                <div class="col main p-5 mt-3  ro-dashboard ">

                    <Card>
                        <Card.Header as="h5">Extra Event</Card.Header>
                        <Card.Body>
                            <Card.Title>Event Title</Card.Title>
                            <Card.Text>
                                Lorem ipsum dolor sit amet consectetur adipisicing elit. Eligendi, quos, suscipit dignissimos quod repellat doloremque aliquam odit eaque ratione ipsam accusantium consequuntur, voluptate sunt accusamus aliquid praesentium voluptatem ipsum iure!
                            </Card.Text>
                            

                                    <Button variant="primary" disabled >Request Send</Button>
                    
                            
                        </Card.Body>
                    </Card>

                </div>
            </section>

        </>);
}

export default ICCRManageEvent
